import s from './Post.module.css';
const Post = (props) => {
    return (
       <div className = {s.item}>
         <img src = 'https://datainteroperability.org/wp-content/uploads/2016/07/noun_48615_cc-e1469818913842-217x217.png' />
    {props.message}
    <div><span>Like</span></div>
     </div>
    )
}
export default Post;
